import React, { Component } from 'react';

const Arrow = ({ position, left, top, width, height, right }) => (
  <button>
    <i
      className='fas fa-arrow-circle-up fa-2x '
      style={{
        position: position,
        left: left,
        top: top,
        width: width,
        height: height,
        right: right
      }}
    ></i>
  </button>
);

export class Static extends Component {
  Home(d) {
    if (d === 1) {
      window.scrollBy(0, 170);
    }
  }
  render() {
    return (
      <div>
        <Arrow
          position='fixed'
          top='600px'
          right='100px'
          onClick={() => this.Home(2)}
        />
      </div>
    );
  }
}

export default Static;
